import React, { Component } from 'react'
import { BrowserRouter as Router, Route } from 'react-router-dom'
//import Route from 'react-router-dom/Route'
import * as ROUTES from '../../constants/routes'

import SignPage from '../Users/sign'
import SignInPage from '../Users/signIn'


class App extends Component {
  state = {
    loggedIn: false
  }
  render() {
    return (
      <Router>
        <div className="App">
        <Route exact strict path={ROUTES.SIGN} component={SignPage}/>
        <Route exact strict path={ROUTES.SIGN_IN} component={SignInPage}/>
          <Route path = "/" exact strict render = {
              () => {
                return (<h1> Welcome to the jungle </h1>)
              }
          }/>
        </div>
      </Router>
    )
  }
}

export default App
